create table nodes
(
    id      bigint auto_increment
        primary key,
    char_id bigint            null,
    x       int               null,
    y       int               null,
    links   tinyint           null,
    type    tinyint           null,
    light   tinyint default 0 null,
    n_link  tinyint           null,
    e_link  tinyint           null,
    s_link  tinyint           null,
    w_link  tinyint           null,
    visited tinyint default 0 null,
    constraint nodes_id_uindex
        unique (id),
    constraint nodes_characters_id_fk
        foreign key (char_id) references game_serve.characters (id)
            on update cascade on delete cascade
);

create index char_id
    on nodes (char_id);

